        var documentWidthInches = this.parseInchesValue(document.width);
        var maxWidthInches = documentWidthInches * (2 / 3);
        if (widthInches > maxWidthInches) {
            var rel = maxWidthInches / widthInches;
            widthInches = maxWidthInches;
            heightInches *= rel;
        }
        // Scales down vertically if still the frame is higher than two thirds of the document height.
        var documentHeightInches = this.parseInchesValue(document.height);
        var maxHeightInches = documentHeightInches * (2 / 3);
        if (heightInches > maxHeightInches) {
            var rel = maxHeightInches / heightInches;
            heightInches = maxHeightInches;
            widthInches *= rel;
        }
